/// <summary>
///    Indicates whether the journal line is category-based.
/// </summary>
/// <returns>
///    true if the journal line is category-based; otherwise, false.
/// </returns>
boolean isCategoryBased()
{
    return !this.ItemId && this.SalesCategory;
}

display LineAmount lineAmountInclTax()
{
    return this.LineAmount + this.LineAmountTax;
}

/// <summary>
///    Retrieves a dimension set that holds the merged combination of the current <c>DefaultDimension</c>
///    field of this table and the specified dimension set.
/// </summary>
/// <param name="_primaryDefaultDimension">
///    A first dimension set to merge with the current <c>DefaultDimension</c> field of this table.
/// </param>
/// <param name="_secondaryDefaultDimension">
///    A second dimension set to merge with the current <c>DefaultDimension</c> field on this table;
///    optional.
/// </param>
/// <param name="_dimensionMerge">
///    A <c>DimensionMerge</c> object that was previously initialized by using the current buffer;
///    optional.
/// </param>
/// <returns>
///    A dimension set that holds the merged combination of the current <c>DefaultDimension</c> field on
///    this table and the specified dimension set.
/// </returns>
/// <remarks>
///    This method makes sure that potential linked dimensions are not overwritten when merging.
///    Additionally, the default of the entity specifier will be considered.
/// </remarks>
public DimensionDefault mergeDimension(DimensionDefault _primaryDefaultDimension,
                                        DimensionDefault _secondaryDefaultDimension = 0,
                                        DimensionMerge   _dimensionMerge = DimensionMerge::newFromTable(this, this.companyInfo().RecId))
{
    return _dimensionMerge.merge(_primaryDefaultDimension, _secondaryDefaultDimension);
}

