display client server QuotationConfirmId quotationDocNum()
{
    CustQuotationConfirmJour   custQuotationConfirmJour = this.custQuotationConfirmJour();

    if (custQuotationConfirmJour)
    return custQuotationConfirmJour.QuotationDocNum;

    return this.QuotationConfirmId;
}

display UnitOfMeasureReportingText salesUnitTxt()
{
    CustQuotationConfirmJour   custQuotationConfirmJour = this.custQuotationConfirmJour();

    if (custQuotationConfirmJour)
    return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
        UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
        custQuotationConfirmJour.LanguageId);

    if (this.SalesId)
    return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
        UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
        SalesTable::find(this.SalesId).LanguageId);

    return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
    UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
    CompanyInfo::languageId());
}

static CustQuotationConfirmTrans findRecId(RecId       recId,
                                boolean     update = false )
{
    CustQuotationConfirmTrans custQuotationConfirmTrans;

    custQuotationConfirmTrans.selectForUpdate(update);

    select custQuotationConfirmTrans
    where custQuotationConfirmTrans.RecId== recId;

    return custQuotationConfirmTrans;
}

[SubscribesTo(classStr(DimensionObjectStorageTableReferenceProcessor), delegatestr(DimensionObjectStorageTableReferenceProcessor, impliedDataAreaFieldNameDelegate))]
static void impliedDataAreaFieldNameDelegate(TableId _tableId, FieldId _fieldId, EventHandlerResult _result)
{
    if (_tableId == tableNum(CustQuotationConfirmTrans))
    {
        switch(_fieldId)
        {
            case(fieldNum(CustQuotationConfirmTrans, LedgerDimension)):
            case(fieldNum(CustQuotationConfirmTrans, DefaultDimension)):
                _result.result(fieldStr(CustQuotationConfirmTrans, Company));
                break;
        }
    }
}
